import React from 'react';

// import { useParams } from 'react-router-dom';

import './App.css';
import Hero from "./Hero"

import { Route, Routes } from 'react-router-dom';
import FullCard from './FullCard';
import NextCard from './NextCard';
import Header from './comp/Header/Header';
import Footer from './comp/Footer/Footer';
import { Homepage } from './comp/Homepage/Homepage';

function App() {

const categoriData = [
  {
    categoritype: "Endast Vuxna", 
    categoriImg: "https://cdn.glitch.global/b8bfc950-5347-4077-bd94-1e2db9ffd2ee/colosseum-in-rome-italy-2021-08-26-16-34-15-utc.jpeg?v=1664265152632"

  },
  {
    categoritype: "Familjehotell", 
    categoriImg: "https://cdn.glitch.global/b8bfc950-5347-4077-bd94-1e2db9ffd2ee/kids-playing-on-the-edge-of-the-pool-2022-05-03-05-17-48-utc.jpeg?v=1664265142892"
  },
  {
    categoritype: "Vintersport", 
    categoriImg: "https://cdn.glitch.me/b8bfc950-5347-4077-bd94-1e2db9ffd2ee/woman-in-bikini-on-beach-2022-02-02-03-49-15-utc.jpeg?v=1664268040112"
  }, 
  {
    categoritype: "Solsemester", 
    categoriImg: "https://cdn.glitch.global/b8bfc950-5347-4077-bd94-1e2db9ffd2ee/austria-salzburg-young-couple-skiing-on-mountain-2022-03-08-01-22-33-utc.jpeg?v=1664265142680"
  }
]  

const data = [
  {
    title: "HTML",
    description: "This is HTML",
    nextCardinfo: "only on next card 1"
  },
  {
    title: "CSS",
    description: "This is CSS",
    nextCardinfo: "only on next card 2"
  },
  {
    title: "JS",
    description: "This is JS",
    nextCardinfo: "only on next card 3"
  },
  {
    title: "REACT",
    description: "This is REACT",
    nextCardinfo: "only on next card 4"
  },
  {
    title: "C#",
    description: "This is C#",
    nextCardinfo: "only on next card 5"
  },
  {
    title: "Angular",
    description: "This is Angular",
    nextCardinfo: "only on next card 6"
  }
]


  return (
    <div className="App">


      <Header/>






      <Routes>
        <Route exact path="/" element={<Hero data={data}/>}></Route>
        <Route path='/cards/:title' element={<FullCard data={data}/>}></Route> 
        <Route path='/cards/nextcard/:title' element={ <NextCard data={data}/>}></Route> 
        <Route path="/homepage" element={ <Homepage categoriData={categoriData}/> }></Route> 

      </Routes>

      <Footer/>


    </div>
  );
}

export default App;
